import React from "react";
import { useParams } from "react-router-dom";

function ProjectPage() {
  const { id } = useParams();

  // Use the id in your component logic

  return (
    <div>
      <h1>Project Page</h1>
      <p>Project ID: {id}</p>
    </div>
  );
}

export default ProjectPage;
